import "./App.css";
import "./ant-design.css";
import { LoginOutlined, HomeOutlined } from "@ant-design/icons";
import { Breadcrumb, Layout, Menu, theme } from "antd";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import LoginPage from "./LoginPage";
import RegisterPage from "./RegisterPage";
import MenuItem from "antd/es/menu/MenuItem";
const { Header, Content, Footer } = Layout;
function getItem(label, key, icon, children) {
  return {
    key,
    icon,
    children,
    label,
  };
}
const items = [
  getItem("Register/Login", "1", <LoginOutlined />),
  getItem("Home", "2", <HomeOutlined />),
];
function App() {
  const {
    token: { colorBgContainer },
  } = theme.useToken();

  return (
    <Layout className="layout">
      <Header>
        <Router>
          <Menu theme="dark" mode="horizontal">
            <Menu.Item key={"1"} icon={<LoginOutlined />}>
              <Link to={"./RegisterPage"}>Register/Login</Link>
            </Menu.Item>
            <MenuItem key={"2"} icon={<HomeOutlined />}>
              Home
            </MenuItem>
          </Menu>
        </Router>
      </Header>
      <Content
        style={{
          padding: "50px 50px",
        }}
      >
        {/* part for breadcrumbs, look up layout page */}
        <div
          className="site-layout-content"
          style={{
            background: colorBgContainer,
          }}
        >
          {/*content of each page */}
          <div
            className="login-wrap"
            style={{
              display: "flex",
              margin: "10% auto",
              justifyContent: "center",
              width: "200px",
              height: "250px",
            }}
          >
            <LoginPage></LoginPage>
          </div>
        </div>
      </Content>
      <Footer
        style={{
          textAlign: "center",
        }}
      >
        noFil[lter] Â©2023 Created by GOFC
      </Footer>
    </Layout>
  );
}

export default App;
